import React, { Component } from 'react';
import {Nav,Navbar,NavDropdown,Form,FormControl,Button} from 'react-bootstrap'


class Navigation extends Component {
    constructor(props){
        super(props)
        this.state = {
          project
        };
      }

    render() {
        return (
            <Navbar bg="light" expand="lg" sticky="top">
                <Navbar.Brand href="/">Family Archive</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="mr-auto">
                        <Nav.Link href="/">Home</Nav.Link>
                        <Nav.Link href="/collections">Collections</Nav.Link>
                        <Nav.Link href="/people">People</Nav.Link>
                    </Nav>
                    <NavDropdown title="Project" id="projects">
                        <NavDropdown.Item href="/project/1">Project1</NavDropdown.Item>
                        <NavDropdown.Item href="/project/2">Project2</NavDropdown.Item>
                        <NavDropdown.Divider />
                        <NavDropdown.Item>Create Project</NavDropdown.Item>
                    </NavDropdown>
                    <Form inline>
                        <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                        <Button variant="outline-success">Search</Button>
                    </Form>
                </Navbar.Collapse>
            </Navbar>
        )
    }
}

export default Navigation
